B.CQ=new A.R("Virtual touchscreen","Stability improvements","This version contains a fix for a problem with not being able to process input data after reloading the Flutter App.")
B.BF=new A.R("Audio playback","Stability improvements","The Audio Capture app that used to provide audio from Android to the Browser has been replaced with a new low-level implementation that integrates directly with the Android framework responsible for generating the audio stream before it\u2019s broadcasted to the actual hardware(HDMI, headphone jack, etc.). This new approach brings in a lot of other improvements:\n\u2022 Increased audio quality (stereo PCM 48kHz - Lossless Audio)\n\u2022 Support for DRM content (streaming services)\n\u2022 Support for volume control in Android (available in the Android Settings app)")
B.DK=new A.R("Flutter app","Stability improvements","The Flutter App has been refactored to improve stability. Here are some of the changes:\n\u2022 WebSockets handling for Tesla Android services has been improved.\n\u2022 Thanks to the new transport layer, the Virtual Display component is now powered by Flutter. This significantly improves stability when compared to the previously used Iframe-based approach.\n\u2022 The connectivity state observer component has been introduced. The app will notify you when it wouldn\u2019t be able to access Tesla Android services. This change ensures you will not have to manually reload the app when your car returns from sleep or the hardware itself restarts.\n\u2022 Flutter Framework has been updated to version 3.3.10")
B.Cl=new A.R("USB tethering for iOS","Connectivity improvements","Version 2023.4.1 adds support for sharing the internet from iOS devices via USB. Connect your phone, enable tethering and accept the USB access permission request on your iPhone.")
B.CL=new A.R("LTE Modem support","Connectivity improvements","This update introduces a new Android system service. The Tesla Android USB Networking Initializer simplifies how USB Modems are initialized and allows the use of per-device configuration scripts. This change resolved issues with some variants of Alcatel devices and added support for more Huawei modems.")
